  return (
    <div className="App">
      <header className="header">
      <h1>Welcome to Moviedux</h1>
      </header>
      <Header/>
      <footer className='footer'>
        <p className='footer'> footer here</p>
      </footer>
    </div>
  );
}

export default App;
